ALTER TABLE `dsodetail` RENAME TO `dsodetail_tmp`;
CREATE TABLE IF NOT EXISTS `dsodetail` (
	`id`	TEXT NOT NULL,
	`ra`	REAL,
	`dec`	REAL,
	`magnitude`	REAL,
	`surfacebrightness`	REAL,
	`sizemin`	REAL,
	`sizemax`	REAL,
	`positionangle`	REAL,
	`nrofstars`	REAL,
	`brighteststar`	REAL,
	`constellation`	TEXT,
	`dsotype`	TEXT,
	`dsoclass`	TEXT,
	`notes`	TEXT,
	`syncedfrom`	TEXT,
	`lastmodified`	TEXT,
	PRIMARY KEY(`id`)
);

INSERT INTO `dsodetail` (id,ra,dec,magnitude,surfacebrightness,sizemin,sizemax,positionangle,nrofstars,brighteststar,constellation,dsotype,dsoclass,notes,syncedfrom,lastmodified) 
	SELECT id,ra,dec,magnitude,surfacebrightness,sizemin,sizemax,positionangle,nrofstars,brighteststar,constellation,dsotype,dsoclass,notes,syncedfrom,lastmodified 
	FROM `dsodetail_tmp`;

UPDATE `dsodetail` SET positionangle = NULL WHERE positionangle = '';
UPDATE `dsodetail` SET nrofstars = NULL WHERE nrofstars = '';
UPDATE `dsodetail` SET brighteststar = NULL WHERE brighteststar = '';
UPDATE `dsodetail` SET brighteststar = replace(brighteststar, ',', '.') WHERE brighteststar LIKE '%,%';

DROP TABLE `dsodetail_tmp`;

